import { AppBar, Box, Button, Toolbar, Typography } from "@mui/material";
import React from "react";

const Home = () => {
	return (
		<Box sx={{ flexGrow: 1 }}>
			<AppBar position="static">
				<Toolbar>
					<Typography
						variant="h6"
						noWrap
						component="div"
						sx={{ flexGrow: 1, display: { xs: "none", sm: "block" } }}
					>
						Dog Gallery
					</Typography>
					<Button sx={{ color: "blue" }}>Custom Search</Button>
				</Toolbar>
			</AppBar>
		</Box>
	);
};

export default Home;
